import { unicodeJsonObject } from './unicodeJsonObject.js';
function unicodeJson(constraints) {
    const arb = constraints != null ? unicodeJsonObject(constraints) : unicodeJsonObject();
    return arb.map(JSON.stringify);
}
export { unicodeJson };
